$(document).ready(function(){$.ajax({url:"/web/quest/matchlist/"+matchid,type:"GET",success:function(s){"ok"!==s.status?console.log("error res:",s):s.data.forEach(s=>{const t=$('<div class="muser-list-item">\n\t<span class="muser-list-item-user"></span>\n\t<span class="muser-list-item-matchid"></span>\n</div>');$("#muser-list-body").append(t),$.ajax({url:"/web/user/info/"+s.userid+"/info",type:"GET",success:function(s){"ok"!==s.status||t.children(".muser-list-item-user:first").text(s.data.username)}}),t.children(".muser-list-item-matchid:first").html($(`<a href="/web/quest/matchcheck?muserid=${s.id}"></a>`).text(s.id))})}})});